import ProductsList from './components/ProductsList';
import data from './data';
import React from 'react';
import Header from './components/Header';

class App extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      products:data,
      orders:[]
    }
  }
  render(){
    return (
      <div className="App">
        <Header/>
        <ProductsList items={this.state.products}/>
      </div>
    );
  }
}

export default App;
